import { ApplicationConfig } from '@angular/core';
import { provideRouter } from '@angular/router';
import { provideHttpClient } from '@angular/common/http';

import { routes } from './app.routes';
import { CampaignRepositoryPort } from './domain/ports/out/campaign-repository.port';
import { CampaignRepositoryAdapter } from './infrastructure/adapters/campaign-repository.adapter';

export const appConfig: ApplicationConfig = {
  providers: [
    provideRouter(routes),
    provideHttpClient(),
    { provide: CampaignRepositoryPort, useClass: CampaignRepositoryAdapter }
  ]
};
